import React from 'react';
import '../App.css';
import { render } from 'react-dom';

const Todo = () => {


   return ( 
   <div>

    <h4 style="cursor:pointer" onClick="()=>this.toggle()">
        Click to {this.state.open ? 'close' : 'open'}
    </h4>
    <p rt-if="this.state.open">This is my paragraph. It opens and
                               closes</p>

  </div>
  )
}

export default Todo
